import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './auth/login/login.component';
import { AuthGuard } from './auth/auth.guard';
import { PrescriptionListComponent } from './prescriptions/prescription-list/prescription-list.component';
import { PrescriptionFormComponent } from './prescriptions/prescription-form/prescription-form.component';
import { ReportComponent } from './reports/report/report.component';
import { RxInteractionsComponent } from './rx/rx-interactions/rx-interactions.component';

const routes: Routes = [
  { path: 'login', component: LoginComponent },
  {
    path: '',
    canActivate: [AuthGuard],
    children: [
      { path: '', redirectTo: 'prescriptions', pathMatch: 'full' },
      { path: 'prescriptions', component: PrescriptionListComponent },
      { path: 'prescriptions/create', component: PrescriptionFormComponent },
      { path: 'prescriptions/:id/edit', component: PrescriptionFormComponent },
      { path: 'reports/day-count', component: ReportComponent },
      { path: 'rxnav', component: RxInteractionsComponent }
    ]
  },
  { path: '**', redirectTo: '' }
];

@NgModule({ imports: [RouterModule.forRoot(routes)], exports: [RouterModule] })
export class AppRoutingModule {}
